import React from "react";

type Props = {
    cityList: Array<string>;
    activeCity: string;
    onCityClick : Function;
};

type State = {
};

class CityNav extends React.Component<Props, State> {
    constructor(props : Props) {
        super(props);
    }

    render() {
        let listItems = this.props.cityList.map((cityName) => {
            <li>
                <div className={`city-nav-item ${this.props.activeCity === cityName ? "active" : ""}`} 
                    onClick={() => {this.props.onCityClick(cityName)}}>
                    {cityName}
                </div>
            </li>
        })

        return (
            <nav className="city-nav">
                <ul className="city-nav-list">
                    <li>
                        <div className={`city-nav-item ${this.props.activeCity === "St. John's" ? "active" : ""}`} 
                             onClick={() => {this.props.onCityClick("St. John's")}}>
                            St. John's
                        </div>
                    </li>
                    <li>
                        <div className={`city-nav-item ${this.props.activeCity === "Tokyo" ? "active" : ""}`} 
                             onClick={() => {this.props.onCityClick("Tokyo")}}>
                            Tokyo
                        </div>
                    </li>
                    <li>
                        <div className={`city-nav-item ${this.props.activeCity === "Madrid" ? "active" : ""}`} 
                             onClick={() => {this.props.onCityClick("Madrid")}}>
                            Madrid
                        </div>
                    </li>
                </ul>
            </nav>
        )
    }
}

export default CityNav;
